  true,\n\t\"url\": null,\n\t\"notes\": \"Flight Standards Service (AFS), Aircraft
  Certification Service (AIR) and the Office of Aerospace Medicine (AAM) use non-governmental
  entities to perform certain duties of the Federal Aviation Administration (FAA).
  These non-governmental entities are commonly referred to as u2018Designees.u2019
  These Designees perform various examinations, inspection and temporary issuance
  functions on behalf of the Administrator, although they are not employees of the
  FAA. Designees are utilized based on FAA need, ability to manage, and designee applicant
  qualifications. The AFS, AIR, and AAM organizations fall under the Associate Administrator
  for Aviation Safety (AVS).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
